function tra() {
var divBase;
var winExis =  $("#emVal").val();

        if(divBase == undefined && winExis == undefined)
        {
         divBase = '<div id="txtEmTr" style="display:none;><div role="alertdialog" class="cx-alert cx-chat-close"  padding:10px;margin-top:80%;text-align: center;"><div class="cx-wrapper text-center"><p style="display:none;" id="lblEmTtl">Email address</p><p id="confmsg" class="i18n" style="display:none;">Transcript will be emailed when chat is completed.</p><input class="cx-input cx-form-control text-center" id="emVal" placeholder="Email address" ></input><span id="lblError" style="color:red;display:none;">Email not valid</span><br><div class="cx-button-group cx-buttons-binary"><button class="cx-close-cancel cx-btn cx-btn-default i18n" id="btnCancel" onClick="cld()" tabindex="0">Cancel</button><button id="confirmBtn" onClick="u()" class="cx-close-confirm cx-btn cx-btn-primary i18n" tabindex="0">OK</button></div></div></div></div><div id="smok" class="cx-webchat-smokescreen" style="display:none"></div>';
         $(".cx-body").append(divBase);         
        }

    
    $("#txtEmTr, #lblEmTtl, #smok").css('display', 'block');
    $("#txtEmTr, #smok, #lblEmTtl").show();
    $("#emVal").val(email);
}

function cld() {
    
    $('#txtEmTr, #smok').css('display', 'none');
    
}

function valEmail(e) {

    var pattern = new RegExp(/^(("[\w-\s]+")|([\w-]+(?:\.[\w-]+)*)|("[\w-\s]+")([\w-]+(?:\.[\w-]+)*))(@((?:[\w-]+\.)*\w[\w-]{0,66})\.([a-z]{2,6}(?:\.[a-z]{2})?)$)|(@\[?((25[0-5]\.|2[0-4][0-9]\.|1[0-9]{2}\.|[0-9]{1,2}\.))((25[0-5]|2[0-4][0-9]|1[0-9]{2}|[0-9]{1,2})\.){2}(25[0-5]|2[0-4][0-9]|1[0-9]{2}|[0-9]{1,2})\]?$)/i);
    return pattern.test(e);

}

function u() {

    if (!($('#emVal').val() == "completed") && !valEmail($('#emVal').val())) {
        $('#lblError').show();
    } else {

        if ($("#emVal").val() == "completed") {
            $("#txtEmTr, #smok, #lblEmTtl").css('display', 'none');
            $("#txtEmTr, #smok, #ChTr").hide();
            $('#txtEmTr').remove();

        } else {
            $('#lblError').hide();
            email = $("#emVal").val();
            $("#txtEmTr").removeClass("cx-alert cx-chat-close");
            $("#txtEmTr, #smok, #lblEmTtl").css('display', 'none');
            $("#txtEmTr, #smok, #ChTr, #lblEmTtl").hide();


            oCustomExtension.command('WebChatService.updateUserData', {
                email: email,
                Send_Chat_Transcript: 'true'
            }).
            done(function(e) {

                $('#btnCancel').hide();
                $("#emVal").val('completed');
                $("#emVal, #lblEmTtl").hide();
                $("#txtEmTr").addClass("cx-alert cx-general");
                $("#txtEmTr, #confmsg, #smok").css('display', 'block');
                $("#txtEmTr, #confmsg, #smok").show();


            }).fail(function(e) {

                alert('WebChatService did not update user data successfully');
            });

        }
    }
}
